import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Dashboard from "./webpages/Dashboard";
import Dashboard2 from "./webpages/Dashboard2";
import Forms from "./webpages/Forms";
import Homepage from "./webpages/Homepage";
import Login from "./webpages/Login";
import Products from "./webpages/Products";
import Registration from "./webpages/Registration";
import Subscription from "./webpages/Subscription";
import User from "./webpages/User";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="/dashboard2" element={<Dashboard2 />} />
        <Route path="/forms" element={<Forms />} />
        <Route path="/" element={<Homepage />} />
        <Route path="/login" element={<Login />} />
        <Route path="/registration" element={<Registration />} />
        <Route path="/subscription" element={<Subscription />} />
      </Routes>
    </Router>
  );
}

export default App;
